import React from "react"
import styledComponents from "../styled-components/styledComponents"
const { H1 , Content } = styledComponents


const NotFound = ()=> {
	return (
		<Content>
				<H1>Page Not Found!</H1>
		</Content>
	
	)
}

export default NotFound
